CREATE DEFINER=`root`@`localhost` PROCEDURE `GetTeacherInfo`(IN teacher_Surname VARCHAR(255))
BEGIN
    SELECT
		teacher.id AS ID,
        chair.ShortNameChair AS Кафедра,
        post.NamePost AS Должность,
        teacher.Surname AS Фамилия,
        teacher.FirstName AS Имя,
        teacher.Patronymic AS Отчество,
        teacher.DateOfBirth AS Дата_рождения,
        teacher.Inn AS ИНН,
        teacher.Snils AS СНИЛС
    FROM
        teacher
    INNER JOIN
        post ON teacher.IdPost = post.ID
    INNER JOIN
        chair ON teacher.IdChair = chair.ID
    WHERE
        teacher.Surname = teacher_Surname;
END ;;
